import './Main.css';
import React from 'react';



function MainDialogBox() {
    return (
        <div className="Main-Container">
            <p></p>
            <GetLocation/>
            <p>位置情報は周辺の飲食店情報を取得するためだけに使用されます</p>
            <SkipGetLocation/>
        </div>
    );

}

function GetLocation() {
    const button = '位置情報の取得を許可する';
    return <span className="GetLocationButton">{button}</span>;

}

function SkipGetLocation() {
    const button = 'ルーレットだけ遊ぶ';
    return <span className="SkipGetLocationButton">{button}</span>;

}


export default MainDialogBox;
